def group_in_10s(*args):
    if not args:
        return []
    tens = defaultdict(list)
    for n in sorted(args):
        tens[n // 10].append(n)
    max_key = max(tens)
    result = [tens.get(d, None) for d in range(max_key - 1)]
    return result

